// Signin.js

import React from "react";
import { NavLink, Route, Routes } from "react-router-dom";
import "./sign_in.css";
import Login from "./login";
import Registration from "./registration";
import Navbar from "../../Components/Navbar/Navbar";
import Footer from "../Footer/Footer";

const Signin = () => {
  return (
    <div>
      <Navbar />
      <div className="center-container">
        <div className="signin-page">
          <ul className="nav nav-pills mb-3 d-flex justify-content-center" id="pills-tab" role="tablist">
            <li className="nav-item" role="presentation">
              <NavLink className="nav-link" to="/signin/login" activeClassName="active" role="tab">
                Login
              </NavLink>
            </li>
            <li className="nav-item" role="presentation">
              <NavLink className="nav-link" to="/signin/register" activeClassName="active" role="tab">
                Register
              </NavLink>
            </li>
          </ul>
          <div className="tab-content" id="pills-tabContent">
            <Routes>
              <Route path="/signin/login" component={Login} />
              <Route path="/signin/register" component={Registration} />
            </Routes>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Signin;
